</head>
<body>
<div id="app"></div>
<script>
    window.$docsify = {
        loadSidebar: 'sidebar.md',
        loadNavbar: 'sidebar.md',
        alias: {
      '/.*/sidebar.md': '/sidebar.md'

        subMaxLevel: 3,
        logo: 'https://elimintz.github.io/favicon.png',
        search: {
            paths: 'auto',
            maxAge: 10000,
            depth: 6
        },
        name: 'JustPy',

        repo: 'https://github.com/elimintz/TestPy',
        pagination: {
        crossChapter: true
      }
    }
</script>
